import React from 'react';
import styles from './index.module.css';

function Star({color}) {
    let theme;
    switch (color) {
        case "GRAY":
            theme = styles.gray;
            break;
        case "LIGHTGRAY":
            theme = styles.light_gray;
            break;
        case "YELLOW":
            theme = styles.yellow;
            break;   
        default:
            theme = styles.gray;
    }
    return (
        <div className = {styles.starbox}>txt
            <div className={theme}>
                <div className={styles.star}></div>
            </div>
        </div>
    )
}

export default Star
